import styled from 'styled-components'

const Outer = styled.div`
    font-family: 'Overpass Mono', monospace , sans-serif;
    margin: 8% 0 2% 0;  

    h3{
        margin: 1em;
        margin-bottom: 4em;
    }

    .second-title{
        border: 2px solid black;
    }
`

export default Outer;
